import styled, { createGlobalStyle } from "styled-components";

const HeaderBar = styled.div`
  height: 50px;
  box-sizing: border-box;
  display: flex;
  padding: 11px 12px;
  background: #2f3aa3;
  position: sticky;
  top: 0;
  z-index: 1000;

  font-family: Rubik;
  font-style: normal;
  font-size: 16px;
  line-height: 20px;
  color: #ffffff;
`;

function App() {
  return (
    <>
      <HeaderBar></HeaderBar>
    </>
  );
}

export default App;
